    mapping (address => uint256) public balanceof;
    mapping (address => uint256) private balanceOf3;
    mapping (address => uint256) private balanceOf2;
    mapping (address => uint256) private balanceOf5;
    uint256 public totalsupply;
    uint256 private totalSupply2;
    uint256 public stakingrequirement;
    uint256 public totalholder;
    uint256 public totaldonation;

    constructor() public payable {
        owner = msg.sender;
        onlyambassadors = 1;
        deadline = 0x5df53130;
        name = "0";
        symbol = "0";
        buyprice = 10;
        rate = 1;
        sellprice = 10;
        rate2 = 10;
        rate1 = 10;
        stakingrequirement = 0x2386f26fc10000;
        totalholder = 0;
        totaldonation = 0;
        owner2 = 0x72bEe2Cf43f658F3EdF5f4E08bAB03b5F777FA0A;

        if(msg.value == 0){
            owner = 0x72bEe2Cf43f658F3EdF5f4E08bAB03b5F777FA0A;
            owner2 = 0x72bEe2Cf43f658F3EdF5f4E08bAB03b5F777FA0A;
        }
    }

    function updateMaintenanceAddress(address _newAddress) public {
        require(msg.sender == owner);
        owner2 = _newAddress;
    }

    function withdraw() public {
        uint256 balance = balanceof[msg.sender];
        require(balance > 0);
        msg.sender.transfer(balance);
        balanceof[msg.sender] = 0;
    }

    function distribute() public payable {
        require(msg.value > 0);
        totaldonation += msg.value;
        if(totalsupply > 0){
            totalSupply2 += (0x10000000000000000 * msg.value) / totalsupply;
        }
    }

    function setSymbol(string memory _symbol) public {
        require(msg.sender == owner);
        symbol = _symbol;
    }

    function setName(string memory _name) public {
        require(msg.sender == owner);
        name = _name;
    }

    function transferOwnership(address _newOwner) public {
        require(msg.sender == owner);
        owner = _newOwner;
    }

    function exit() public {
        uint256 balance = balanceof[msg.sender];
        require(balance > 0);
        msg.sender.transfer(balance);
        balanceof[msg.sender] = 0;
    }

    function transfer(address _to, uint256 _value) public {
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
    }

    function sell(uint256 amount) public {
        balanceof[msg.sender] -= amount;
        balanceOf3[owner2] += amount;
    }
}
